                 # Empty holes stand for missing expressions, patterns, or \
                 types #\n\
                 let empty_hole =   in\n\n\
                 # Integers #\n\
                 let int_lits : Int = 1 in\n\
                 let negation = -1 in\n\
                 let arithmetic = 1*2 + 8/4 in\n\
                 let int_comparison = (10 == 10, 1 < 2, 2 <= 3, 3 > 2, 2 >= 1) \
